import React from 'react';


const FaceRecognition = ({imageURL}) => {
	return (
		<div className='center ma pa3'>
			<img 
				alt='image_ur_gonna_see' 
				src={imageURL}
				width='500px'
				height='auto'
				/>
		</div>
	)
}

export default FaceRecognition;
